def solve(A, B):
    invA = 0
    invB = 0
    for i in range(len(A)):
        for j in range(i+1, len(A)):
            if A[i] > A[j]:
                invA += 1
    for i in range(len(B)):
        for j in range(i+1, len(B)):
            if B[i] > B[j]:
                invB += 1
